Indebtedness could have significant consequences, including the following:
•reduced ability to execute the Company’s growth strategy, including merger and acquisition opportunities;
•reduced ability to invest in the Company, which may place it at a competitive disadvantage;
•increased vulnerability to adverse economic and industry conditions;
•exposure to interest rate increases;
•reduced cash flow available for other purposes; or
•limited ability to borrow additional funds for working capital, capital expenditures and other investments. The Company’s level of indebtedness may further increase from time to time. Although the Company’s agreements governing indebtedness contain restrictions on the incurrence of additional indebtedness, these restrictions are subject to a number of significant qualifications and exceptions and, under certain circumstances, the amount of indebtedness, including secured debt, that could be incurred in compliance with these restrictions could be substantial. Incurring substantial additional indebtedness could further exacerbate the risks associated with the Company’s level of indebtedness.
